import React, {useState, useEffect} from 'react'
import './bootstrap-5.2.1/dist/css/bootstrap.min.css';
import './jquery.js';
import './bootstrap-5.2.1/dist/js/bootstrap.min.js';

function Test(){
    const [data,setData]=useState("0");

    useEffect(()=>{
        fetch("/")
        .then(encode=>encode.json())
        .then(data=>{   
            setData(data);
            console.log(data);
        })
    },[])

    return(
        <>

        </>
    )
}

export default Test;
